import "./App.css";

import Person from "./components/Person";

function App() {
  return (
    <div>
      <Person
        name="Puffy"
        img="https://cdn.pixabay.com/photo/2023/06/22/15/17/cat-8081701_640.jpg"
        color="gray"
      />
    </div>
  );
}

export default App;
